pragma solidity ^0.4.17;

import "../base/IbaseLib.sol";
import "./timelineDocuments/TimelineDocument.sol";

/**
 * A library of functions used to build out an immutable and immortal timeline.
 *
 * Copyright (c) 2017 Cognate, Inc.
 */
library ITimelineLib {

    struct TimelineStorage {
        uint16 _version;
        bytes32 _interfaceID; // adds some basic protection against corrupting a timeline
        bool _upgraded;
        Timeline _previous;
        TimelineDocument _next; // the first (and next from the start) TimelineDocument in this timeline
        TimelineDocument _tail; // the last TimelineDocument in this timeline
    }

    /**
     * Constructor logic for a timeline.
     */
    function init(TimelineStorage storage self, Timeline previous);

    /**
     * TODO
     *
     * Transfer ownership of this contract to the new version of this contract
     * calling the new owning contracts finalize method to perform any logic necessary
     * to finalize the state of the old contract.
     */
    function upgrade(TimelineStorage storage self, Timeline to);

    /**
     * Ensures that provided TimelineDocument is both owned by this timeline and adheres to the TimelineDocument
     * interface and appends the provided TimelineDocument to this timeline.
     */
    function append(TimelineStorage storage self, TimelineDocument document);

    /**
     * Creates TimelineDocument from bytecode and appends it to this timeline.
     */
    function appendBytes(TimelineStorage storage self, bytes documentCode);

    /**
     * Allows the top level owning Timeline to call functions of any contract.
     */
    function callFunctionOf(address target, uint value, bytes data) returns (bool);

    /**
     * Removes a specified TimelineDocument from this timeline, reconciling pointers
     * of surrounding TimelineDocuments.
     */
    function remove(TimelineStorage storage self, TimelineDocument target);
}
